      SELECT DISTINCT col2 * + col1 FROM tab1 (FORMAT parquet) WHERE col1 * - col1 - 45 * + 74 BETWEEN NULL AND + + col0 / - - col2 AND NULL NOT BETWEEN ( NULL ) AND NULL;
  - name: tab1

outputs:
  - name: q6820.out
    data: |
